  }
  render() {
    const { cookieStore } = mobxStore;
    return (
      <Provider {...mobxStore}>
        <Router>
          <Switch>
            <PropsRoute
              UIset={UIset["login"]}
              exact
              path={getURI("login")}
              to="/"
              component={
                !cookieStore.checkIsLogin() ? LoginContainer : Redirect
              }
            />
          </Switch>
        </Router>
      </Provider>
    );
  }
}
```

#### 2. model

```javascript
import { Code } from "../components/index";

class Model {
