```

- entity 정보 모델
- state 기본값 정의 등
- validation 과 서버 DATA 가공하여 표현

#### 3. mobx

```javascript
import { observable, action } from "mobx";
import { userApis } from "../apis";

class cookieStore {
  @observable
  isLogin = false;

  @action
  setLogin = params => {
    return userApis.setLogin(params).then(() => {
      this.checkIsLogin();
    });
  };

  @action
  setLogout = () => {
    userApis.setLogout().then(() => {
      this.isLogin = false;
    });
  };
}

export default new cookieStore();
```

- 전역적인 state 관리
- api 호출

#### 4. apis

```javascript
