- api 메소드 정의

### 결론

- Back-end 와 Front-end 프로젝트로 분리로 개발이 한층 편해졌고 각자의 분야에 집중할수 있었다.
- Webpack으로 인해 model,apis 등 util성 script 들도 모듈화 하고 관리가 편해짐.
- 최대한 React 내부에서 처리할수 있도록 했고 구조화 설계를 정립했다.
